import React from "react";
import ReactDOM  from "react-dom";


function App() {
    var count = 0;
    function increase() {
        count++;
        ReactDOM.render( <div>
            <button>{count}</button>
            <button onClick={increase}>+</button>
        </div>,
            document.getElementById("root"));
    }
    return (
        <div>
            <button>{count}</button>
            <button onClick={increase}>+</button>
        </div>
    )

}




export default App;
